import styled from 'styled-components';




const styleddiv = styled.div
`   display: flex;
    align-items: center;
    justify-content: center;
    height: 100%;
    backgroud-color:#f5f5f5;
    width: 60%;
    height:50%;
`;

class Forestpage extends React.Component{

    componentDidMount()
    {
        document.body.style.backgroundColor = "#dbdbdb";
    }
    render(){
        return(
            <stylediv>
                <p>forest</p>
            </stylediv>
        );
    }
}
export default Forestpage;
